import React, {useState} from "react";
import axios from "axios";

export function Partner(){
    const [cred , setCred] = useState();


    const submitresponse= (event) => {
        console.log(event.target.username)
        axios.post("http://localhost:9087/partner",cred)
            .then(response => {console.log(response)})
            .catch(error => {console.log(error)})
        event.preventDefault()

    }

    return (
        <form onSubmit={submitresponse}>
            Store Name: <input type="text"  value={cred.storeName} onChange={(e)=>{setCred({...cred,storeName:e.target.value})}}/>
            Store Location: <input type="text" value={cred.storeLoc} onChange={(e)=>{setCred({...cred,storeLoc:e.target.value})}}/>
            Phone: <input type="text" value={cred.contactno} onChange={(e)=>{setCred({...cred,contactno:e.target.value})}}/>
            Email: <input type="text" value={cred.email} onChange={(e)=>{setCred({...cred,email:e.target.value})}}/>
            Username: <input type="text" value={cred.username} onChange={(e)=>{setCred({...cred,username:e.target.value})}}/>
            Password: <input type="password" value={cred.password} onChange={(e)=>{setCred({...cred,password:e.target.value})}}/>
            <input type="submit" onChange={submitresponse}/>

        </form>
    )
}
